import React from 'react';

const Container = (props) => {
  return (
    <div style={styles.container}>
      "hi"
    </div>
  );
};

const styles = {
  containerStyle: {
    margin: '40px auto',
    padding: 40,
    position: 'relative',
    height: '100%',
    width: '70%',
    border: '2px solid grey',
    borderRadius: 10,
  },
};

export default Container;
